import React from 'react';
import styled from 'styled-components';

const AdminContainer = styled.div`
    background-color: #fff;
    width: 1400px;   
    height: 800px;
    border-radius: 2px;
    box-shadow: 0px 5px 10px 1px #0004;
    padding: 30px 60px;
`;

const AdminArea = () => {
    return (
        <AdminContainer>
        </AdminContainer>
    );
};

export default AdminArea;
